document
  .getElementById("addPdfRapido")
  .addEventListener("click", async function () {
    // Datos definidos como constantes
    const fecha = new Date().toLocaleDateString();
    const cuenta = "01"; // Reemplaza por número real de cuenta
    const nombreCliente = "Cliente Preferencial";
    const cedulaCliente = "--";

    // Llamada a la función generadora
    await generatePDF(fecha, cuenta, nombreCliente, cedulaCliente);
  });

async function generatePDF(fecha, cuenta, nombreCliente, cedulaCliente) {
  const { jsPDF } = window.jspdf;
  const doc = new jsPDF({
    orientation: "portrait",
    unit: "mm",
    format: "a4",
  });
  // ===== CONFIGURACIÓN DE DISEÑO =====
  const brandColor = [249, 29, 37]; // Rojo corporativo
  const darkText = [40, 40, 40]; // Texto principal
  const lightBrand = [252, 209, 210]; // Fondo destacado
  const pageWidth = doc.internal.pageSize.getWidth();
  const margin = 15;
  const contentWidth = pageWidth - margin * 2;

  // ===== ENCABEZADO PROFESIONAL =====
  // Logo o marca
  const logo =
    "data:image/png;base64,";

  if (logo) {
    doc.addImage(logo, "PNG", margin + 10, 18, 75, 12);
  } else {
    doc.setFontSize(16);
    doc.setTextColor(...brandColor);
    doc.setFont("helvetica", "bold");
    doc.text("TRANSMICAJAS", margin, 20);
    doc.setFontSize(9);
    doc.setTextColor(...darkText);
    doc.text("Especialistas en accesorios vehiculares", margin, 25);
  }

  // ===== BLOQUE DE CONTACTOS PERFECTAMENTE AJUSTADO =====
  const contactBox = {
    width: 75,
    x: pageWidth - margin - 75,
    y: 12,
    height: 28,
  };

  // Fondo del cuadro de contactos
  doc.setDrawColor(...brandColor);
  doc.setFillColor(248, 248, 248);
  doc.roundedRect(
    contactBox.x,
    contactBox.y,
    contactBox.width,
    contactBox.height,
    3,
    3,
    "FD"
  );

  // Contenido de contactos (perfectamente alineado)
  doc.setFontSize(9);
  doc.setTextColor(...darkText);

  // Título "CONTACTO"
  doc.setFont("helvetica", "bold");
  doc.text("CONTACTO", contactBox.x + 5, contactBox.y + 7);

  // Línea divisoria bajo el título
  doc.setDrawColor(...brandColor);
  doc.line(
    contactBox.x + 5,
    contactBox.y + 8.5,
    contactBox.x + 60,
    contactBox.y + 8.5
  );

  // Elementos de contacto (iconos Unicode compatibles)
  doc.setFont("helvetica", "normal");
  doc.text("Cel: 321 2707166", contactBox.x + 5, contactBox.y + 14);

  // Email dividido si es necesario
  const emailText = doc.splitTextToSize(
    "Correo: transmicajas.oficial@gmail.com",
    contactBox.width - 10
  );
  doc.text(emailText, contactBox.x + 5, contactBox.y + 19);

  doc.text("web: transmicajas.com", contactBox.x + 5, contactBox.y + 24);

  // ===== LÍNEA SEPARADORA ESTILIZADA =====
  doc.setDrawColor(...brandColor);
  doc.setLineWidth(0.3);
  doc.line(margin, 42, pageWidth - margin, 42);
  doc.setDrawColor(200, 200, 200);
  doc.line(margin, 43, pageWidth - margin, 43);

  // ===== TÍTULO PRINCIPAL =====
  doc.setFontSize(18);
  doc.setTextColor(...brandColor);
  doc.setFont("helvetica", "bold");
  doc.text("COTIZACIÓN FORMAL", pageWidth / 2, 55, { align: "center" });

  // ===== INFORMACIÓN DE LAS PARTES =====
  doc.setFontSize(10);
  doc.setTextColor(...darkText);

  // Panel del Emisor
  doc.setFillColor(250, 250, 250);
  doc.roundedRect(margin, 62, 85, 38, 3, 3, "F");
  doc.setDrawColor(220, 220, 220);
  doc.roundedRect(margin, 62, 85, 38, 3, 3, "D");

  doc.setFont("helvetica", "bold");
  doc.text("DATOS DEL EMISOR:", margin + 8, 70);
  doc.setFont("helvetica", "normal");
  doc.text("Almacén y Taller Transmicajas", margin + 8, 76);
  doc.text("NIT: 10000000", margin + 8, 82);
  doc.text("Duitama, Boyacá, Colombia", margin + 8, 88);
  doc.text("Tel: 321 2707166", margin + 8, 94);

  // Validez de la cotización
  doc.setFontSize(8);
  doc.setTextColor(100, 100, 100);
  doc.text("Válido por 15 días", margin + 28, 98);
  // ===== PANEL DEL CLIENTE REORGANIZADO =====
  const clientPanel = {
    x: margin + 100,
    y: 62,
    width: 80,
    height: 38,
  };

  // Fondo del panel del cliente
  doc.setFillColor(250, 250, 250);
  doc.roundedRect(
    clientPanel.x,
    clientPanel.y,
    clientPanel.width,
    clientPanel.height,
    3,
    3,
    "F"
  );
  doc.setDrawColor(220, 220, 220);
  doc.roundedRect(
    clientPanel.x,
    clientPanel.y,
    clientPanel.width,
    clientPanel.height,
    3,
    3,
    "D"
  );

  // Contenido del panel del cliente
  doc.setFontSize(10);
  doc.setTextColor(...darkText);
  doc.setFont("helvetica", "bold");
  doc.text("DATOS DEL CLIENTE:", clientPanel.x + 5, clientPanel.y + 8);
  doc.setFont("helvetica", "normal");

  if (nombreCliente || cedulaCliente) {
    if (nombreCliente) {
      const nombreLines = doc.splitTextToSize(
        nombreCliente,
        clientPanel.width - 15
      );
      doc.text("Nombre:", clientPanel.x + 5, clientPanel.y + 14);
      doc.text(nombreLines, clientPanel.x + 20, clientPanel.y + 14);
    }
    if (cedulaCliente) {
      doc.text("ID/NIT:", clientPanel.x + 5, clientPanel.y + 20);
      doc.text(cedulaCliente, clientPanel.x + 20, clientPanel.y + 20);
    }
  } else {
    doc.text("Consumidor final", clientPanel.x + 5, clientPanel.y + 14);
  }

  // ===== PANEL DE DATOS DEL DOCUMENTO REUBICADO =====
  const docPanel = {
    x: pageWidth - margin - 30,
    y: clientPanel.y - 18, // ← movido hacia arriba
    width: 42,
    height: 15,
  };

  // Contenido del panel del documento
  doc.setFont("helvetica", "bold");
  doc.text(`No. ${cuenta || "---"}`, docPanel.x, docPanel.y + 7);
  doc.text(`Fecha: ${fecha || "---"}`, docPanel.x, docPanel.y + 11);
  // ===== TABLA DE PRODUCTOS PROFESIONAL =====
  let startY = 110;

  // Encabezado de tabla
  doc.setFillColor(...brandColor);
  doc.roundedRect(margin, startY, contentWidth, 8, 3, 3, "F");

  doc.setTextColor(255, 255, 255);
  doc.setFont("helvetica", "bold");
  doc.text("Ítem", margin + 8, startY + 5.5);
  doc.text("Cant.", margin + 25, startY + 5.5);
  doc.text("Descripción del Producto/Servicio", margin + 45, startY + 5.5);
  doc.text("Valor", pageWidth - margin - 8, startY + 5.5, { align: "right" });

  startY += 12;

  // Obtener datos de productos
  const table = document.querySelector(".productos-seleccionados-table");
  const rows = table?.querySelectorAll("tbody tr") || [];
  let totalSum = 0;

  // Procesar cada fila
  rows.forEach((row, index) => {
    // Control de paginación
    if (startY > 250) {
      doc.addPage();
      startY = 20;
      // Encabezado continuado
      doc.setFontSize(10);
      doc.setTextColor(100, 100, 100);
      doc.text("CONTINUACIÓN DE COTIZACIÓN", pageWidth / 2, 15, {
        align: "center",
      });
      startY += 15;
    }

    const cells = row.querySelectorAll("td");
    if (cells.length >= 6) {
      const cantidad =
        cells[4].querySelector("input")?.value ||
        cells[4].textContent.trim() ||
        "1";

      const nombreProducto =
        cells[1].querySelector(".producto-nombre")?.textContent.trim() ||
        "Producto sin nombre";

      const productoMarca =
        cells[1].querySelector(".producto-marca")?.textContent.trim() ||
        "Marca no especificada";

      // Parsear y acumular el subtotal (aunque no se muestre)
      const subtotal =
        parseFloat(
          cells[5].textContent
            .trim()
            .replace("$", "")
            .replace(/\./g, "")
            .replace(",", ".")
        ) || 0;

      totalSum += subtotal;

      // Dividir nombre del producto en líneas si es largo
      const descripcionLines = doc.splitTextToSize(nombreProducto, 90);
      const rowHeight = Math.max(descripcionLines.length * 5, 8);

      // Dibujar fila con marca en lugar de subtotal
      doc.setTextColor(...darkText);
      doc.setFont("helvetica", "normal");

      doc.text(`${index + 1}`, margin + 8, startY + 3);
      doc.text(`${cantidad}`, margin + 25, startY + 3);
      doc.text(descripcionLines, margin + 45, startY + 3);

      // Mostrar la marca del producto en lugar del subtotal
      doc.setFont("helvetica", "italic"); // Puedes omitir esto si no quieres cursiva
      doc.text(productoMarca, pageWidth - margin - 8, startY + 3, {
        align: "right",
      });

      doc.setFont("helvetica", "normal"); // Restablecer fuente por si sigue
      // Ya no se dibuja el subtotal aquí
      // doc.text(subtotalFormatted, pageWidth - margin - 8, startY + 3, {
      //   align: "right",
      // });

      // Línea separadora sutil
      doc.setDrawColor(230, 230, 230);
      doc.line(
        margin,
        startY + rowHeight + 2,
        pageWidth - margin,
        startY + rowHeight + 2
      );

      startY += rowHeight + 6;
    }
  });

  if (rows.length === 0) {
    doc.text("No hay productos seleccionados.", margin, startY);
    startY += 10;
  }

  // ===== SECCIÓN DE TOTALES DESTACADA =====

  const subtotal = totalSum / 1.19;
  const iva = totalSum - subtotal;
  const totalConIva = totalSum; // Ya incluye IVA

  // Marco para totales
  doc.setDrawColor(200, 200, 200);
  doc.setFillColor(250, 250, 250);
  doc.roundedRect(pageWidth - margin - 75, startY + 5, 75, 30, 3, 3, "FD");

  // Subtotal (ahora correctamente sin IVA)
  doc.setFontSize(10);
  doc.setTextColor(...darkText);
  doc.text("Subtotal:", pageWidth - margin - 50, startY + 13, {
    align: "right",
  });
  doc.text(`$${formatNumber(subtotal)}`, pageWidth - margin - 10, startY + 13, {
    align: "right",
  });

  // IVA (19% calculado desde el subtotal)
  doc.text("IVA (19%):", pageWidth - margin - 50, startY + 20, {
    align: "right",
  });
  doc.text(`$${formatNumber(iva)}`, pageWidth - margin - 10, startY + 20, {
    align: "right",
  });

  // Total ya con IVA
  doc.setFontSize(12);
  doc.setTextColor(...brandColor);
  doc.setFont("helvetica", "bold");
  doc.text("TOTAL:", pageWidth - margin - 50, startY + 28, { align: "right" });
  doc.text(
    `$${formatNumber(totalConIva)}`,
    pageWidth - margin - 10,
    startY + 28,
    {
      align: "right",
    }
  );

  // ===== SECCIÓN DE VALOR AÑADIDO =====
  startY += 40;

  // Verificar si hay suficiente espacio en la página actual
  // (Considerando que cada ítem de beneficios ocupa ~3.2 unidades y el QR ocupa ~60 unidades)
  const espacioNecesario = 40 + beneficios.length * 3.2 + 60;
  const espacioDisponible = doc.internal.pageSize.height - startY - 20; // 20 para margen inferior

  if (espacioDisponible < espacioNecesario) {
    doc.addPage(); // Crear nueva página
    startY = 40; // Resetear la posición Y para la nueva página
  }

  doc.setFontSize(10);
  doc.setTextColor(...brandColor);
  doc.setFont("helvetica", "bold");
  doc.text("¿POR QUÉ ELEGIRNOS?", margin, startY);

  doc.setFontSize(9);
  doc.setTextColor(...darkText);
  doc.setFont("helvetica", "italic");

  beneficios.forEach((item, i) => {
    doc.text(item, margin + 5, startY + 8 + i * 3.2);
  });

  // ===== FIRMA Y PIE DE PÁGINA =====
  const footerY = Math.max(startY + beneficios.length * 5 + 15, 250);

  // 👉 Aquí insertas el QR
  const qrBase64 =
    "data:image/png;base64,"; // Pon aquí tu Base64

  // 🔄 Coordenadas modificadas para mover todo un poco a la izquierda
  const qrX = margin + 130;
  const qrY = footerY - 45;
  const qrSize = 40;

  // Verificar nuevamente espacio para el QR (por si acaso)
  if (doc.internal.pageSize.height - qrY < qrSize + 20) {
    doc.addPage();
    qrY = 40; // Ajustar posición Y en nueva página
  }

  // 1️⃣ Insertar QR grande
  doc.addImage(qrBase64, "PNG", qrX, qrY, qrSize, qrSize);

  // 2️⃣ Línea justo debajo del QR
  const lineY = qrY + qrSize + 2;
  doc.setDrawColor(150, 150, 150);
  doc.line(qrX, lineY, qrX + qrSize, lineY);

  // 3️⃣ Texto centrado debajo de la línea
  doc.setFont("helvetica", "normal");
  doc.setFontSize(8);
  doc.text(
    "Verifique autenticidad con el código QR",
    qrX + qrSize / 2,
    lineY + 8,
    {
      align: "center",
    }
  );

  // Pie de página profesional
  doc.setFontSize(9);
  doc.setTextColor(100, 100, 100);
  const footerText = [
    `¡${nombreCliente}, gracias por considerar nuestros servicios para su vehículo!`,
    "Esta cotización no constituye una obligación de compra",
    `Documento generado el ${new Date().toLocaleDateString("es-CO", {
      year: "numeric",
      month: "long",
      day: "numeric",
      hour: "2-digit",
      minute: "2-digit",
    })}`,
  ];

  footerText.forEach((text, i) => {
    doc.text(text, pageWidth / 2, footerY + 15 + i * 5, { align: "center" });
  });

  // ===== GUARDAR DOCUMENTO =====
  const nombreArchivo = `Cotizacion_${cuenta || "SN"}_${formatFileName(
    nombreCliente || "Cliente"
  )}.pdf`;
  doc.save(nombreArchivo);

  /*Datos guardar registro*/

  // ===== FUNCIONES AUXILIARES =====
  function formatNumber(number) {
    return new Intl.NumberFormat("es-CO", {
      minimumFractionDigits: 2,
      maximumFractionDigits: 2,
    }).format(number);
  }

  function formatFileName(name) {
    return name
      .substring(0, 20)
      .normalize("NFD")
      .replace(/[\u0300-\u036f]/g, "") // Elimina acentos
      .replace(/\s+/g, "_")
      .replace(/[^a-zA-Z0-9_]/g, "");
  }
}
